import { Trash3Fill } from "react-bootstrap-icons";
import { DayProps } from "../Interfaces/Day";

function Foo({day}: DayProps) {
  const handleFoo = async (e: React.MouseEvent<HTMLButtonElement, MouseEvent>) => {
    alert();
  };

  return (
    <Card.Body>
      <Card.Title>
        {day.name} <Button className="btn-trash float-end" onClick={handleFoo(day.id)}><Trash3Fill /></Button>
      </Card.Title>
    </Card.Body>
  );
}

export default Foo;
